import logo from './gone-phishin/front-end/src/Go phising (Logo)-Picsart-BackgroundRemover.png';
import './App.css';
import EmailScanner from './EmailScanner';

function App() {
  return (
    <div className="App">
      <EmailScanner />
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}
export default App;
// This is a simple React application that includes an EmailScanner component.
